import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find the "Your Profile" link - use all strategies to ensure we get the correct one
    // Try to find the link that navigates to Jun's Profile (should trigger the profile view)
    // We'll use text selector and click the first visible one

    // Wait for at least one "Your Profile" link to appear
    await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // There are multiple "Your Profile" links; click the first visible one
    const profileLinks = await page.$$('a:text("Your Profile")');
    let clicked = false;
    for (const link of profileLinks) {
      if (await link.isVisible()) {
        await link.click();
        clicked = true;
        break;
      }
    }

    if (!clicked) throw new Error('No visible "Your Profile" link found');

    // Wait for Jun's profile to appear (look for Jun's full name or profile image)
    // Wait for either Jun's full name or profile image to appear
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_jun_profile.png'));

    // Extract Jun's profile data for verification
    const fullName = await page.textContent('.profile-info h2');
    const username = await page.textContent('.profile-info .username');
    const bio = await page.textContent('.profile-info .bio');
    const stats = await page.$$eval('.profile-stats .stat', els =>
      els.map(stat => ({
        number: stat.querySelector('.stat-number')?.textContent?.trim(),
        label: stat.querySelector('.stat-label')?.textContent?.trim()
      }))
    );

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile details",
      extractedData: {
        fullName,
        username,
        bio,
        stats
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
